import React from 'react';
import { Link } from 'react-router-dom';
import Carousel from '../components/Carousel';
import './Inicio.css';

function Inicio() {
    return (
        <div className="inicio-page">
            <Carousel /> {/* Certifique-se de que o carrossel está funcionando */}

            {/* Container para as seções */}
            <div className="sections-container">
                <div className="section-box">
                    <Link to="/aluguel-de-onibus" className="section-link">
                        <div className="section-inner">
                            <img src={require('../assets/frete.png')} alt="Frete de Ônibus" />
                            <div className="section-overlay">Frete de Ônibus</div>
                        </div>
                    </Link>
                </div>

                <div className="section-box">
                    <Link to="/turismo" className="section-link">
                        <div className="section-inner">
                            <img src={require('../assets/turismo.png')} alt="Turismo" />
                            <div className="section-overlay">Turismo</div>
                        </div>
                    </Link>
                </div>

                <div className="section-box">
                    <Link to="/nossa-frota" className="section-link">
                        <div className="section-inner">
                            <img src={require('../assets/frota.png')} alt="Nossa Frota" />
                            <div className="section-overlay">Nossa Frota</div>
                        </div>
                    </Link>
                </div>
            </div>
        </div>
    );
}

export default Inicio;
